aliz="Face analysis...",V.description_product_text="<p>Как много Вы знаете о себе и окружающих?</p><p>Ведь все такие разные.</p><p>Узнавайте о себе новые характеристики, посмотрите на других цифровыми глазами наших нейросетей определяющих красоту, интеллект, характер, возраст, сексуальность, брак, любовь, здоровье, потенциал, успешность, религиозность, преступность, азартность, атлетичность, артистичность, экстрасенсорность, профессию, потребности, страхи, кредитоспособность, экстремальность, силу.</p><p>Пользуйтесь нестандартным чтением по лицам.<br>В каждом из нас таится столько хорошего и тайного, делитесь этим с близкими и обществом, возможно, это поразит Ваше воображение.</p><p>Знать себя, меняться, совершенствоваться.<br>Вовремя раскрыть новые качества ребенка, развивать их в будущем.</p><p>Как Вас характеризует анатомия лица, что заложено в его потенциал?</p><p>Открывайте все лица наново.</p><p>Попробуйте видеть окружающих новым зрением.</p>",G.description_product_text="<p>How much do you know about yourself and those around you?</p><p>After all, everyone is so different.</p><p>Learn about new characteristics about yourself, look at others with the digital eyes of our neural networks that determine beauty, intelligence, character, age, sexuality, marriage, love, health, potential, success, religiosity, crime, gambling, athleticism, artistry, extrasensory perception, profession, needs, fears, creditworthiness, extremeness, strength.</p><p>Use custom face reading.<br>There are so much good and secret in each of us, share it with relatives and society, perhaps this will amaze your imagination.</p><p>Know yourself, change, improve.<br>In time to reveal new qualities of the child, to develop them in the future.</p><p>How do you characterize the anatomy of the face, which is embedded in its potential?</p><p>Open all faces anew.</p><p>Try to see others with a new vision.</p>",V.description_product_text_mb='<p>Ресурс с помощью нейронной сети анализирует фото на предмет заболевания.</p><p>Функционал позволяет получить информацию о вероятных заболеваниях на фотографии.</p><p>Фото сканируется в нейронной сети в зависимости от выбранного Вами направления (специализации нейронной сети).</p><p><b>Раздел "Все болезни"</b> - нейронная сеть охватывает многие направления медицины, такие как дерматология, офтальмология, ревматология, флебология, венерология, трихология, стоматология, ортопедия, вирусология, отоларингология, гинекология, онкология, хирургия, и др.<br><p>Нейронные сети обучены на базе более 100 тысяч фотографий и содержат информацию свыше чем об 800 заболеваний с внешними признаками проявления.</p><p>Сфотографируйте и посмотрите, что найдет на фото нейронная сеть.</p><p>Данный ресурс не является врачебной консультацией и не заменяет медицинское обследование.<br>Это информационный помощник, который не учитывает индивидуальные факторы и особенности организма конкретного человека.</p><p>Проконсультируйтесь с доктором в случае возникновения каких-либо вопросов относительно Вашего здоровья или здоровья Ваших близких.</p>',G.description_product_text_mb='<p>A resource using a neural network analyzes a photo for a disease.</p><p>Functionality allows you to get information about probable diseases in the photo.</p><p>The photo is scanned in the neural network depending on the direction you have chosen (specialization of the neural network).</p><p><b>Section "All Diseases"</b> - the neural network covers many areas of medicine, such as dermatology, ophthalmology, rheumatology, phlebology, venereology, trichology, dentistry, orthopedics, virology, otolaryngology, gynecology, oncology, surgery, etc.<br><p>The neural network is trained on the basis of more than 100 thousand photographs and contains information on more than 800 diseases with external signs of manifestation.</p><p>Take a picture and see what the neural network will find in the photo.</p><p>This resource is not a medical consultation and does not replace a medical examination.<br>This is an information assistant that does not take into account the individual factors and characteristics of the body of a particular person.</p><p>Consult a doctor if you have any questions regarding your health or the health of your loved ones.</p>',V.pay_description_p1="Для осуществления приема платежей на сайте мы пользуемся услугами платежной системы LiqPay.",G.pay_description_p1="To make payments on the site, we use the services of the LiqPay payment system.",V.pay_description_p2="Выбрать удобный из доступных вариантов оплаты Вы можете при получении Кода доступа на этапе заполнения формы оплаты.",G.pay_description_p2="You can choose the most convenient from the available payment options upon receipt of the Access Code at the stage of filling out the payment form.",V.descr_return_p1="После оплаты за доступ к сканированию фото, в течении 24 часов у Вас есть возможность отправить запрос на возврат средств.",V.descr_return_p2="Условия и причины возврата средств указаны в пункте 4.4 документа",V.descr_return_p3="Обращаем внимание, что обязательным условием при запросе на возврат средств является наличие квитанции об оплате.<br>После оплаты интерфейс платежной системы дает возможность отправить электронную копию квитанции, указав свой email.<br>Рекомендуем пользоваться этой возможностью после каждой оплаты.",G.descr_return_p1="After paying for access to photo scanning, within 24 hours you have the opportunity to send a request for a refund.",G.descr_return_p2="The conditions and reasons for the refund are indicated in paragraph 4.4 of the document",G.descr_return_p3="Please note that a prerequisite for a request for a refund is a receipt of payment. <br> After payment, the payment system interface allows you to send an electronic copy of the receipt by indicating your email. <br> We recommend using this option after each payment.",V.quesch_1="Что такое код доступа?",V.quesch_2="Сколько лиц можно сканировать имея код доступа?",V.quesch_2_mb="Сколько раз можно сканировать фото для определения вероятного заболевания?",V.quesch_3="В каком случае ресурс успешно распознает и сканирует лицо?",V.quesch_3_mb="Какие рекомендации при отправке фото на сканирование для определения вероятного заболевания?",G.quesch_1="What is an access code?",G.quesch_2="How many faces can I scan with an access code?",G.quesch_2_mb="How many times can a photo be scanned to determine a likely disease?",G.quesch_3="In which case does a resource successfully recognize and scan a face?",G.quesch_3_mb="What are the recommendations when sending photos for scanning to determine the likely disease?",V.answer_1="<ul><li>Чтобы сканировать фото нужно получить код-доступ к ресурсу.<br>Его нужно указывать каждый раз при отправке фото на сканирование.</li><li>Код доступа предоставляется в момент оформлеиня платежа.</li><li>При каждой новой оплате выдается новый код доступа.</li><li>Код доступа дает возможность сканировать фото на разных доступных разделах сайта.</li></ul>",V.answer_2="<ul><li>Код доступа дает возможность сделать 1 успешное сканирование лица.</li><li>Успешным результатом сканирования считается тот случай, когда после отправки лица Вы сможете посмотреть результаты сканирования в виде анкет.</li><li>Если после отправки лица на сканирования система не сможет распознать лицо и выдать результаты сканирования -- этот случай не считается успешным сканом. В этом случае Вы сможете повторно отправить лицо на сканирование.</li></ul>",V.answer_2_mb="<ul><li>Код доступа дает возможность 1 раз сканировать фото для определения вероятного заболевания.</li></ul>",V.answer_3="<ul><li>Фотографии должны быть в хорошем качестве.</li><li>Фотографировать нужно при хорошем дневном освещении.</li><li>Лицо на фотографии должно быть в анфас.</li><li>Лицо не должно быть на фотографии слишком отдалено (не должно быть на дальнем заднем плане).</li></ul>",V.answer_3_mb="<ul><li>- отправляйте фото в хорошем качестве (фото не должно быть размытым);</li><li>- делайте фото при хорошем освещении;</li><li>- при фотографировании следуйте изображению-инструкции;</li><li>- не допускайте чтобы на фото присутствовали посторонние предметы (элементы одежды, мебели, автомобилей, ...).</li><li>Фото отправляется на сканирование в том виде, в котором Вы видите его в окне подгрузки.<br>Чтобы увеличить акцент на проблемной части тела (или убрать с изображения посторонние предметы) Вы можете приближать или двигать фото в окне подгрузки перед отправкой его на сканирование.</li></ul>",G.answer_1="<ul><li>To scan a photo, you need to get a code-access to the resource.<br>You need to specify it every time you send a photo for scanning.</li><li>The access code is provided at the time of payment.</li><li>With each new payment, a new access code is issued.</li><li>The access code makes it possible to scan photos on various accessible sections of the site.</li></ul>",G.answer_2="<ul><li>The access code allows you to make 1 successful face scan.</li><li>A successful scan result is a case when after sending a face you can see the scan results in the form of profiles.</li><li>If, after sending a face for scanning, the system cannot recognize the face and give out the scan results, this case is not considered a successful scan. In this case, you can send your face for scanning again.</li></ul>",G.answer_2_mb="<ul><li>The access code makes it possible to scan a photo once to determine a probable disease.</li></ul>",G.answer_3="<ul><li>Photos must be in good quality.</li><li>Photographs must be in good daylight.</li><li>The face in the photograph must be in full view.</li><li>Face should not be too distant in the photo (should not be in the background).</li></ul>",G.answer_3_mb="<ul><li>- send photos in good quality (the photo should not be blurry);</li><li>- take a photo in good light;</li><li>- when photographing, follow the image-instructions;</li><li>- do not allow foreign objects to appear on the photo (items of clothing, furniture, cars, ...).</li><li>The photo is sent for scanning in the form in which you see it in the upload window.<br>To increase the emphasis on the problem part of the body (or remove foreign objects from the image), you can zoom in or move the photo in the upload window before sending it for scanning.</li></ul>",V.title_enter_group="Выберите область тела",G.title_enter_group="Choose body area",V.group_body_top="Голова<br>Шея",G.group_body_top="Head<br>Neck",V.group_body_middle="Плечи<br>Грудь<br>Живот<br>Спина<br>Руки",G.group_body_middle="Shoulders<br>Chest<br>Abdomen<br>Back<br>Hands",V.group_body_bottom="Половые органы<br>Таз<br>Ноги",G.group_body_bottom="Genitals<br>Pelvis<br>Feet",V.group_body_neck="Шея",G.group_body_neck="Neck",V.group_body_abdomen="Живот",G.group_body_abdomen="Abdomen",V.group_body_chest="Грудь",G.group_body_chest="Chest",V.group_body_armpit="Подмышечная<br>впадина",G.group_body_armpit="Armpit",V.group_body_shoulder="Плечо",G.group_body_shoulder="Shoulder",V.group_body_forearm="Предплечье",G.group_body_forearm="Forearm",V.group_body_wrist="Запястье",G.group_body_wrist="Wrist",V.group_body_palm="Ладонь",G.group_body_palm="Palm",V.group_body_groin="Паховая область",G.group_body_groin="Groin",V.group_body_genital="Половые органы",G.group_body_genital="Genital organs",V.group_body_hip="Бедро",G.group_body_hip="Hip",V.group_body_knee="Колено",G.group_body_knee="Knee",V.group_body_shin="Голень",G.group_body_shin="Shin",V.group_body_feet="Стопа",G.group_body_feet="Feet",V.group_body_back_back="Спина",G.group_body_back_back="Back",V.group_body_back_pelvis="Таз",G.group_body_back_pelvis="Pelvis",V.group_body_back_hair="Волосы",G.group_body_back_hair="Hair",V.group_body_back_ears="Ухо",G.group_body_back_ears="Ear",V.group_body_back_fossa="Подколенная ямка",G.group_body_back_fossa="Fossa poplitea",V.group_body_palm2="Тыльная сторона ладони",G.group_body_palm2="Back of palm";V.group_body_back_cubit="Локоть",G.group_body_back_cubit="Cubit",V.group_body_face_forehead="Лоб",G.group_body_face_fore